import React from 'react';
import { Grid, Card, CardMedia, CardContent, CardActions, Typography, } from '@mui/material';


const AlumniGrid = ({ AlumniData }) => {
  return (
    <Grid container spacing={3}>
      {AlumniData.map((data, index) => (
        <Grid item xs={12} sm={6} md={4} key={index}>
          <Card sx={{ width: '100%' }}>
            <CardMedia
              component="img"
              alt="alumni image"
              height="140"
              image="/images/alumni_images/page-bg-dark-1.jpg"
            />
            <CardContent>
              <Typography gutterBottom variant="h5" component="div">
                NAME: {data.name}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Domain: {data.domain || "N/A"}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Company: {data.company || "N/A"}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Passout Year: {data.passoutYear || "N/A"}
              </Typography>
            </CardContent>
            <CardActions>
              <Button variant="contained" color="success">
                Request For a meeting
              </Button>
            </CardActions>
          </Card>
        </Grid>
      ))}
    </Grid>
  );
};

export default AlumniGrid;
